function sequence(n: number): number {
    if (n <= 0) throw "Invalid input";

    let current = 1;
    while (current < n) {
        const previousNumber = current - 1;

        switch (previousNumber % 3) {
            case 0: //Previous is multiple of 3
                current += 2 * previousNumber;
                break;

            default:// Previos not multiple of three
                current += 1;
                break;            
        }
    }

    return current;  
}
