function is_nonagonal(n: number) {
    let count = -1;

    // Calculate the first few terms of the series
    while (count < n) {
        if (!isPrime(++count)) continue;

        // The next prime number must have the same digits as the previous one
        var digs = ("" + count).split("").map((d)=>+d);
        while (true) {
            ++digs[0];

            const numStr = digs.join("");
            const newNum = Number.parseInt(numStr);

            // If it's not a prime number, break out of this loop
            if (!isPrime(newNum)){
                break;
            }

            // If we reach the end, then we found the N-th nonagononal number!
            count += Math.abs(n - count);

            return count;
        }
        return null;
    }  
};
