function divisor(n: number) {
    let count = 0;     // Initialize counter variable
    for (let i = 1; i <= n / 2; i++) {  // Loop through integers from 1 to half of `n`
        if (n % i === 0) {             // Check whether i is a factor of `n`
            count++;                   // If it's a factor, increment counter
        }
    }
    return count;       // Return total count of factors
}      ```

